export const getTileImages = () => {
    const tile_images: HTMLImageElement[] = [];
    for (let i = 0; i < TILE_TEXTURES.length; ++i) {
        const img = new Image();
        img.src = TILE_TEXTURES[i];
        tile_images.push(img);
    }
    return tile_images;
};
